response.about:
Меня не было, я был, я есть... 

Буду рад, если кто-то мне напишет;

общества вязальщиков шарфа не существует;

спасибо той, что пригласила меня в контакт;

очень любезен с приличными людьми и совсем нет с людьми неряшливыми;

люблю, - не могу ничего с этим поделать;

могу радоваться не только за себя, но и за других
